import React, { useState, useCallback } from 'react';
import { useDropzone } from 'react-dropzone';
import {
  Container,
  Box,
  Typography,
  Paper,
  Button,
  TextField,
  CircularProgress,
  Alert,
  Snackbar,
  Stepper,
  Step,
  StepLabel
} from '@mui/material';
import axios from 'axios';
import './App.css';

function App() {
  const [file, setFile] = useState<File | null>(null);
  const [title, setTitle] = useState('');
  const [isConverting, setIsConverting] = useState(false);
  const [isPublishing, setIsPublishing] = useState(false);
  const [error, setError] = useState<string | null>(null);
  const [success, setSuccess] = useState<string | null>(null);
  const [activeStep, setActiveStep] = useState(0);

  const steps = ['Convert', 'Publish'];

  const onDrop = useCallback((acceptedFiles: File[]) => {
    if (acceptedFiles.length > 0) {
      setFile(acceptedFiles[0]);
      setActiveStep(0);
    }
  }, []);

  const { getRootProps, getInputProps, isDragActive } = useDropzone({
    onDrop,
    accept: {
      'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet': ['.xlsx']
    },
    multiple: false
  });

  const handleConvert = async () => {
    if (!file) {
      setError('Please select a file');
      return;
    }

    setIsConverting(true);
    setError(null);
    setSuccess(null);

    try {
      const formData = new FormData();
      formData.append('file', file);
      formData.append('action', 'convert');

      await axios.post('http://localhost:5000/api/process', formData, {
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });

      setIsConverting(false);
      setActiveStep(1); // Move to Publish step
    } catch (err) {
      setError('Failed to convert file');
      setIsConverting(false);
    }
  };

  const handlePublish = async () => {
    if (!file || !title) {
      setError('Please select a file and enter a title');
      return;
    }

    setIsPublishing(true);
    setError(null);
    setSuccess(null);

    try {
      const formData = new FormData();
      formData.append('file', file);
      formData.append('title', title);
      formData.append('action', 'publish');

      const response = await axios.post('http://localhost:5000/api/process', formData, {
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });

      setSuccess('File published successfully!');
      setIsPublishing(false);
    } catch (err) {
      setError('Failed to publish');
      setIsPublishing(false);
    }
  };

  const handleCloseSnackbar = () => {
    setError(null);
    setSuccess(null);
  };

  return (
    <Container maxWidth="md">
      <Box sx={{ my: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom>
          File Converter
        </Typography>

        <Stepper activeStep={activeStep} sx={{ mb: 4 }}>
          {steps.map((label, index) => (
            <Step key={label} completed={activeStep > index}>
              <StepLabel>{label}</StepLabel>
            </Step>
          ))}
        </Stepper>

        <Paper
          {...getRootProps()}
          sx={{
            p: 3,
            textAlign: 'center',
            cursor: 'pointer',
            backgroundColor: isDragActive ? '#f0f0f0' : 'white',
            border: '2px dashed #ccc',
            mb: 2
          }}
        >
          <input {...getInputProps()} />
          {isDragActive ? (
            <Typography>Drop the file here...</Typography>
          ) : (
            <Typography>
              Drag and drop a file here, or click to select a file
            </Typography>
          )}
        </Paper>

        {file && (
          <Box sx={{ mb: 2 }}>
            <Typography>Selected file: {file.name}</Typography>
          </Box>
        )}

        <TextField
          fullWidth
          label="Title"
          value={title}
          onChange={(e) => setTitle(e.target.value)}
          sx={{ mb: 2 }}
        />

        <Box sx={{ display: 'flex', gap: 2, mb: 2 }}>
          <Button
            variant="contained"
            color="primary"
            onClick={handleConvert}
            disabled={!file || isConverting || activeStep > 0}
          >
            {isConverting ? (
              <>
                <CircularProgress size={24} sx={{ mr: 1 }} />
                Converting...
              </>
            ) : (
              'Convert'
            )}
          </Button>

          <Button
            variant="contained"
            color="success"
            onClick={handlePublish}
            disabled={!file || !title || isPublishing || activeStep < 1}
          >
            {isPublishing ? (
              <>
                <CircularProgress size={24} sx={{ mr: 1 }} />
                Publishing...
              </>
            ) : (
              'Publish'
            )}
          </Button>
        </Box>

        {activeStep < 1 && (
          <Typography variant="body2" color="text.secondary" sx={{ mt: 1 }}>
            Convert the file first to enable publishing
          </Typography>
        )}

        {activeStep >= 1 && !title && (
          <Typography variant="body2" color="error" sx={{ mt: 1 }}>
            Please enter a title to publish
          </Typography>
        )}

        <Snackbar
          open={!!error || !!success}
          autoHideDuration={6000}
          onClose={handleCloseSnackbar}
        >
          <Alert
            onClose={handleCloseSnackbar}
            severity={error ? 'error' : 'success'}
            sx={{ width: '100%' }}
          >
            {error || success}
          </Alert>
        </Snackbar>
      </Box>
    </Container>
  );
}

export default App;
